import React, {Component} from 'react';
import './Footer.css';

class Footer extends Component {
    render() {
        return(
            <footer>
                <div className="container">
                    <h3>Single Coloured</h3>
                    <hr/>
                        <div className="text-center center-block">
                        <p className="txt-railway">- Bootsnipp.com -</p>
                        <br/>
                        <a href="https://www.facebook.com/bootsnipp"><img
                            className="fa fa-facebook-square fa-3x social bg-white"></img></a>
                        <a href="https://twitter.com/bootsnipp "><img
                            className="fa fa-twitter-square fa-3x social bg-white"></img></a>
                        <a href="https://plus.google.com/+Bootsnipp-page"><img
                            className="fa fa-google-plus-square fa-3x social"></img></a>
                        <a href="mailto:bootsnipp@gmail.com"><img width="50px" height="50px" className="fa fa-envelope-square fa-3x social bg-white"></img></a>
                    </div>
                </div>
            </footer>
        )
    }
}

export default Footer;
